        public bool serviceMailSend(string _to, string _cc, string _from, string _message, string _title)
        {
            bool result = false;
            parameter.MailFrom = _from;
            parameter.MailTo = _to;
            parameter.MailCc = _cc;
            parameter.MailSubject = _title;
            parameter.MailBody = _message;
            parameter.MailFileName = "BdayWish.png";
            FileInfo flInfo = new FileInfo(HttpContext.Current.Server.MapPath("~/Content/BdayWish.png"));
            long numByt = flInfo.Length;

            double dLen = Convert.ToDouble(flInfo.Length / 1000000);

            if (dLen < 4)
            {
                FileStream fStream = new FileStream(HttpContext.Current.Server.MapPath("~/Content/BdayWish.png"), FileMode.Open, FileAccess.Read);

                BinaryReader br = new BinaryReader(fStream);
                byte[] data = br.ReadBytes((int)numByt);

                br.Close();

                parameter.MailAttachments = new System.Collections.Generic.Dictionary<string, byte[]>();
                parameter.MailAttachments.Add("BdayWish.png", data);

                fStream.Close();
                fStream.Dispose();
            }

            clnt.sendMail(parameter);

            return result;
        }

        public void sendMailTo()
        {
            string month = DateTime.Now.Month.ToString();//Get current month
            int day = (int)System.DateTime.Today.Day;
            string day1 = day.ToString(); // get today's day 
            string sql = System.Configuration.ConfigurationManager.AppSettings["SUPERVIORID"].ToString().Replace("{0}", month).Replace("{1}", day1);
            DataTable dt = db.getDataTable(sql);

            foreach (DataRow row in dt.Rows)
            {
                string firstName = row["EMP_Name"].ToString();
                var names = firstName.Split(' ');
                string empname = names[0];
                
                string empmail = row["EmailID"].ToString();
                string supsap_id = row["SUPERVISIOR_SAPID"].ToString();
                string supemail = row["Supervisor_Email"].ToString();
                string channel = row["CHANNEL"].ToString();
                List<string> lstCCmail = new List<string>();
                lstCCmail.Add(supemail);

                if (channel == "Shared")
                {
                    string tnheads = System.Configuration.ConfigurationManager.AppSettings["TNHead_Mail"].ToString();
                    lstCCmail.Add(tnheads);
                }
                string from = System.Configuration.ConfigurationManager.AppSettings["From"].ToString();
                string Cc = System.Configuration.ConfigurationManager.AppSettings["CC"].ToString();
                var cc_strlist = String.Join(",", lstCCmail);

                ClsMail mail = new ClsMail();
                //string msg = mail.Generate_HTML(empname);
                mail.IsSMTP(empmail,cc_strlist, from, empname, "Birthday Wishes " + empname + "!!");
                lstCCmail.Clear();
            }

               

        }

        public bool IsSMTP(string _to,string lstCCmail, string _from, string _message, string _title)
        {
            

            bool retVal = false;
            try
            {
                SmtpClient smtp = new SmtpClient();

                //smtp.Credentials = new NetworkCredential(_uname, _pswd);
                smtp.UseDefaultCredentials = true;
                //smtp.DeliveryMethod = SmtpDeliveryMethod.Network;
                smtp.EnableSsl = false;
                smtp.Host = System.Configuration.ConfigurationManager.AppSettings["server"].ToString();
                smtp.Port = 25;
                MailMessage mail = new MailMessage();
                string path = HttpContext.Current.Server.MapPath("~/Content/BdayWish.png"); // my logo is placed in images folder

                //Attachment at = new Attachment(path);
               // at.ContentId = "BdayWish.png";
                //mail.Attachments.Add(at);
                
                string Body = "<b> Wish you a very Happy Birthday " + _message + "!!!<BR> <br> <br><img alt=\"\" hspace=0 src=\"cid:imageId\" align=baseline border=0 >";

                AlternateView htmlView = AlternateView.CreateAlternateViewFromString(Body, null, "text/html");

                LinkedResource imagelink = new LinkedResource(HttpContext.Current.Server.MapPath(".") + @"\Content\BdayWish.png", "image/png");

                imagelink.ContentId = "imageId";

                imagelink.TransferEncoding = System.Net.Mime.TransferEncoding.Base64;

                htmlView.LinkedResources.Add(imagelink);

                mail.AlternateViews.Add(htmlView);

                mail.IsBodyHtml = true;
                mail.Body = _message;
                //Setting From , To and CC
                mail.From = new MailAddress(_from, _title);
                mail.Subject = _title;
                mail.To.Add(new MailAddress(_to));
                char d = ',';
                string[] temp = lstCCmail.ToString().Split(d);

                foreach (string i in temp)
                {
                    if (i.ToString().Trim() != "")
                    {
                        mail.CC.Add(new MailAddress(i.Trim()));
                    }
                }

                smtp.Send(mail);
                smtp.Dispose();
                retVal = true;
            }
            catch (Exception ex)
            {
                string log = ex.Message;
                retVal = false;
            }
            return retVal;
        }

